import React, { useState } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCoffee } from "@fortawesome/free-solid-svg-icons";

const NavigationBar = (props) => {
  const [showDropdown, setShowDropdown] = useState(false);

  const handleBurgerToggle = () => {
    setShowDropdown((showDropdown) => !showDropdown);
  };

  return (
    <div className="Navbar">
      <div className="Navbar__Link Navbar__Link-brand">Osas Alohan</div>
      <div
        className="Navbar__Link Navbar__Link-toggle"
        onClick={handleBurgerToggle}
      >
        <FontAwesomeIcon icon={faCoffee} />
      </div>
      <nav
        className={`Navbar__Items Navbar__Items--right ${
          showDropdown && "Navbar__ToggleShow"
        }`}
      >
        <div className="Navbar__Link">Link</div>
        <div className="Navbar__Link">Link</div>
      </nav>
    </div>
  );
};

export default NavigationBar;
